import React, {Component} from 'react';
import {Button} from "react-bootstrap";
import App from "../../../App";

function LoginComponent(props) {
    return (
        <div className='container'>
            <h3>Login page</h3>
            <Button onClick={() => {
                props.login(true);
                console.log("Logged")
            }
            }>Login</Button>
        </div>
    )
}

export default LoginComponent;
